<script>
export default {
  name: 'AppNavbar',
  data() {
    return {
      isScrolled: false,
      sidebarOpen: false,
      navLinks: ['Home', 'About Us', 'Our Products', 'Our Services', 'Our Partners'],
    }
  },
  mounted() {
    window.addEventListener('scroll', this.handleScroll)
  },
  beforeUnmount() {
    window.removeEventListener('scroll', this.handleScroll)
  },
  methods: {
    handleScroll() {
      this.isScrolled = window.scrollY > 50
    },
    getLinkPath(link) {
      // Map nav link names to paths
      const paths = {
        Home: '/',
        'About Us': '/about',
        'Our Products': '/products',
        'Our Services': '/services',
        'Our Partners': '/partners',
      }
      return paths[link] || '/'
    },
  },
}
</script>

<style scoped>
.sidebar {
  position: fixed;
  top: 0;
  left: -250px; /* hidden by default */
  width: 250px;
  height: 100%;
  background: rgba(177, 32, 47, 1);
  box-shadow: 2px 0 5px rgba(0, 0, 0, 0.3);
  padding: 2rem 1rem;
  transition: left 0.3s ease;
  z-index: 1050;
  overflow-y: auto;
}

/* Show sidebar when open */
.sidebar.open {
  left: 0;
}

/* Hide sidebar and show normal navbar on large screens */
@media (min-width: 992px) {
  .sidebar {
    position: static;
    width: auto;
    height: auto;
    box-shadow: none;
    padding: 0;
    left: 0 !important;
    display: flex !important;
    overflow: visible;
  }
  .navbar-toggler {
    display: none;
  }
}
</style>
